import React from "react";
import {
  FaHome,
  FaBuilding,
  FaHotel,
  FaCity,
  FaTree,
  FaBriefcase,
} from "react-icons/fa";

const CategorySlider = () => {
  const categories = [
    {
      name: "Kids House",
      icon: <FaHome />,
      count: 12,
      img: "https://images.unsplash.com/photo-1586105251261-72a756497a11?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Budget House",
      icon: <FaBuilding />,
      count: 18,
      img: "https://images.unsplash.com/photo-1570129477492-45c003edd2be?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Luxury House",
      icon: <FaHotel />,
      count: 8,
      img: "https://images.unsplash.com/photo-1501183638710-841dd1904471?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Stylish House",
      icon: <FaCity />,
      count: 14,
      img: "https://images.unsplash.com/photo-1560448204-e02f11c3d0e2?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Apartments",
      icon: <FaHome />,
      count: 22,
      img: "https://images.unsplash.com/photo-1486304873000-235643847519?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Farmhouse",
      icon: <FaTree />,
      count: 9,
      img: "https://images.unsplash.com/photo-1505691938895-1758d7feb511?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Deluxe House",
      icon: <FaHome />,
      count: 7,
      img: "https://images.unsplash.com/photo-1507089947368-19c1da9775ae?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Nature House",
      icon: <FaTree />,
      count: 11,
      img: "https://images.unsplash.com/photo-1505692769274-513d5a9c40b7?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "2 BHK",
      icon: <FaHome />,
      count: 16,
      img: "https://images.unsplash.com/photo-1580587771525-78b9dba3b914?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "3 BHK",
      icon: <FaHome />,
      count: 10,
      img: "https://images.unsplash.com/photo-1556912998-6a321d550f86?auto=format&fit=crop&w=600&q=60",
    },
    {
      name: "Office Rooms",
      icon: <FaBriefcase />,
      count: 5,
      img: "https://images.unsplash.com/photo-1570129477492-45c003edd2be?auto=format&fit=crop&w=600&q=60",
    },
  ];

  const duplicated = [...categories, ...categories];

  // Auto scroll
  const startAutoScroll = () => {
    if (!scrollRef.current) return;
    scrollRef.current.style.animationPlayState = "running";
  };

  const stopAutoScroll = () => {
    if (!scrollRef.current) return;
    scrollRef.current.style.animationPlayState = "paused";
  };

  // Manual buttons
  const slideLeft = () => {
    scrollRef.current.scrollLeft -= 300;
  };

  const slideRight = () => {
    scrollRef.current.scrollLeft += 300;
  };

  return (
    <div className="w-full bg-[#07182E] py-12 relative overflow-hidden">
      <h2 className="text-white text-3xl font-bold text-center mb-6">
        Popular Categories
      </h2>

      {/* BUTTONS */}
      <button
        onClick={slideLeft}
        className="absolute left-2 top-1/2 -translate-y-1/2 bg-white/20 text-white p-3 rounded-full hover:bg-white/40 backdrop-blur-md z-20"
      >
        ❮
      </button>

      <button
        onClick={slideRight}
        className="absolute right-2 top-1/2 -translate-y-1/2 bg-white/20 text-white p-3 rounded-full hover:bg-white/40 backdrop-blur-md z-20"
      >
        ❯
      </button>

      {/* SLIDER */}
      <div
        className="overflow-hidden"
        onMouseEnter={stopAutoScroll}
        onMouseLeave={startAutoScroll}
      >
        <div
          ref={scrollRef}
          className="flex gap-6 animate-loopSlider"
          style={{ width: "max-content" }}
        >
          {duplicated.map((item, index) => (
            <div
              key={index}
              className="min-w-[250px] h-[130px] bg-white/15 backdrop-blur-xl 
              border border-white/20 rounded-2xl shadow-md 
              flex items-center gap-4 p-5 text-white 
              hover:scale-105 transition duration-300 cursor-pointer"
            >
              <div className="text-blue-300 text-3xl">{item.icon}</div>

              <div>
                <h3 className="font-semibold text-lg">{item.name}</h3>
                <p className="text-sm opacity-80">{item.count} available</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* ANIMATION CSS */}
      <style>{`
        .animate-loopSlider {
          animation: autoSlide 25s linear infinite;
        }

        @keyframes autoSlide {
          from { transform: translateX(0); }
          to   { transform: translateX(-50%); }
        }
      `}</style>
    </div>
  );
};
export default CategorySlider;
